import React from 'react';

const ImageViewer = ({ ImageSrc }) => {
    return (
        <div style={{
            position: "relative",

            top: "50%",
            bottom: "50%",

            left: "50%",
        }}
            className="row">
            <div className="one wide column">
                <i style={{
                    position: "relative",

                    top: "50%",
                    bottom: "50%",

                    left: "50%",
                }} className="caret square left icon"></i>
            </div>
            <div className="fourteen wide column">
                <img src="https://upload.wikimedia.org/wikipedia/commons/6/65/Jimmy_Wales_September_2015.jpg" />
            </div>
            <div className="one wide column">
                <i
                    style={{
                        position: "relative",

                        top: "50%",
                        bottom: "50%",

                        right: "50%"
                    }}
                    className="caret square right icon" ></i>
            </div>
        </div >

    )
}

export default ImageViewer;
